import React from 'react'
import CommonSection from '../shared/CommonSection';
import { Container, Row, Col } from 'reactstrap';
import './search-result-list.css'
import { useLocation } from 'react-router-dom';
import TourCard from '../shared/TourCard';

const SearchResultList = () => {
  const location = useLocation();
  const [data]=useState(location.state)
  console.log(data)
  return (
    <>
      <CommonSection title="Search Result" />
      <section>
        <Container>
          <Row>
            <Col lg='12'>
              <div className="search__result__wrapper d-flex justify-content-center flex-wrap gap-3">
                <div className="single__search__item">
                  <h3>Location</h3>
                </div>
                <div className="single__search__item">
                  <h3>Distance</h3>
                </div>
                <div className="single__search__item">
                  <h3>Max Group Size</h3>
                </div>
              </div>
            </Col>
          </Row>
        </Container>
      </section>
      {/* -----------------------------search result list  end------------------------*/}
    </>
  )
};

export default SearchResultList;
